import styled from "styled-components";

export const Estilera = styled.div`
  display: flex;
  flex-direction: column;

  background-color: gray;
  width: 100%;
  height: 1200px;
  color: black;
  position: relative;
`;
export const Botaes = styled.button`
  width: 80px;
`;
